import { StyleSheet} from 'react-native';
const screenInfoTextStyles = StyleSheet.create({
    getStartedContainer: {
        alignItems: 'center',
        marginHorizontal: 50,
        backgroundColor:'#1e2833'
      },
      homeScreenFilename: {
        marginVertical: 7,
      },
      codeHighlightContainer: {
        borderRadius: 3,
        paddingHorizontal: 4,
      },
      getStartedText: {
        fontSize: 17,
        lineHeight: 24,
        marginTop:15,
        textAlign: 'justify',
      },
      helpContainer: {
        marginTop: 15,
        marginHorizontal: 20,
        alignItems: 'center',
      },
      helpLink: {
        paddingVertical: 15,
      },
      helpLinkText: {
        textAlign: 'center',
      },
  });
export {screenInfoTextStyles};
